import Styles from './Pin.module.css';

import PinImg from './PinImg/PinImg';
 const Pin = (props)=> {
     console.log(props.location.state.src);
    return (
            <div className = {Styles.Wrapper}>
                <div className = {Styles.pin}>
                    <PinImg></PinImg>
                </div>
            </div>
            
        
    )
}
export default Pin;
